import { connect } from 'react-redux';


const UsersList = (props) => {
    useEffect(() => {
        async function getUsers(){
            try {
                const data = fetch('/api/v2/users', {
                    headers: {
                      Authorization: props.token,
                    }
                  })
                console.log(data);
            }
            catch (ex) {
                console.log(ex);
            }
        }
        getUsers();
    }, []);

